import Post from "@/components/Post";
import Layout from "@/layout";
import { StarIcon } from "@chakra-ui/icons";
import { Heading, Divider, Stack, Button, Flex } from "@chakra-ui/react";
import Head from "next/head";

export default function Starred() {
  return (
    <Layout>
      <Head>
        <title>Starred posts</title>
      </Head>

      <Flex align="center" justifyContent="flex-start" w="100%">
        <StarIcon size="lg" w={5} h={5} mr={2} />{" "}
        <Heading textAlign="left">Starred Posts</Heading>
      </Flex>

      <Divider my={5} />

      <Stack w="100%">
        <Post />
        <Post />
        <Post />
        <Button>Show more</Button>
      </Stack>
    </Layout>
  );
}
